import { AxiosResponse } from "axios";

import { BaseUser, RegisterUser, RegisterUserResponse } from '../../types';

import api  from './../';

export default class AuthService {
  static register = (data: RegisterUser): Promise<AxiosResponse<RegisterUserResponse>> => {
    return api.post('/auth/register', data);
  }

  static login = (data: BaseUser): Promise<AxiosResponse<RegisterUserResponse>> => {
    return api.post('/auth/login', data);
  }
}
